import React from "react";
const NavBar = () => {
  <div className="navBar">
    return(
    <ul>
      <li>Home</li>
      <li>About</li>
      <li>Skills+Certicications</li>
      <li>Projects</li>
      <li>Contact</li>
    </ul>
    );
  </div>;
};
export default NavBar;
